import { Box, Container, CssBaseline, Grid, Paper, makeStyles } from "@material-ui/core"
import Header from "../../componets/header"
import GridTask from "../../componets/gridTask"

const useStyles = makeStyles({
    paddingTop10: {
        paddingTop: "10%",
    },
    alingPaper: {
        padding: 20, 
        textAlign: 'center',
    },
    box: {
        backgroundColor: "#E1E1E1"
    },
    height100: {
        height: "80vh"
    }
})

function PageMain(){
    const classes = useStyles()


    return(
        <Container className={classes.height100} component="main" maxWidth="lg">
            <CssBaseline/>
            <Box>
                <Header/>
            </Box>
            <Box>
                <Grid container spacing={2} className={`${classes.paddingTop10} ${classes.height100}`}>
                    <Grid item xs={12} sm={4} className={classes.height100}>
                        <Box className={`${classes.alingPaper} ${classes.box} ${classes.height100}`}>
                            A fazer
                        </Box>
                        <Box className={`${classes.box} `}>
                            Botão
                        </Box>
                        <GridTask
                            title={"A fazer"}
                            onHandleClick={addTask}
                        />
                    </Grid>
                    <Grid item xs={12} sm={4} className={classes.height100}>
                        <Paper className={classes.alingPaper} elevation={4}>
                        Conteúdo da Coluna 2
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={4} className={classes.height100}>
                        <Paper className={classes.alingPaper} elevation={4}>
                        Conteúdo da Coluna 3
                        </Paper>
                    </Grid>
                </Grid>
            </Box>
        </Container>
    )
}
export default PageMain
